import React from "react";

class SignUp extends React.Component {
  constructor() {
    super();
    this.state = {
      name: "",
      email: ""
    }
    this.handleChange = this.handleChange.bind(this);
  }

  handleChange(event) {
    debugger
    this.setState({
      name: event.target.value
    })
  }

  render() {
    return (
      <>
      <h1>
      Sign Up!
      </h1>
      <form>
      <label htmlFor="name"> Name </label>
      <input onChange={this.handleChange} type="text" placeholder="Your Name" name="name" value={this.state.name} id="name" />
      <br />
      <label htmlFor="name"> Email </label>
      <input type="text" placeholder="Your Email" name="email" value="" id="email" />
      </form>
      </>
    )
  }
}

export default SignUp;
